import './css/App.css';
import Login from './components/login';
import {ApolloClient, InMemoryCache, ApolloProvider} from '@apollo/client';

const client = new ApolloClient({
  uri: 'http://localhost:5000', // The GraphQL server URL
  cache: new InMemoryCache(),
});

function App() {
  return (
    <ApolloProvider>
      <div className="App">
        <Login></Login>
    </div>
    </ApolloProvider>
  );
}

export default App;
